export enum Difficulty {
    EASY = 'easy',
    MEDIUM = 'medium',
    HARD = 'hard',
}

export const fetchQuizQuestions = async (
    amount: number,
    difficulty: Difficulty
) => {
    const endpoint = `https://opentdb.com/api_config.php?amount${amount}&difficulty=${difficulty}`;
    const res = await fetch(endpoint);
    const data = await res.json();
    console.log(data);
};
